import React, {setState, Fragment} from 'react';
import './LoggedIn.css';
import logo from '../resources/r1.jpg';

const LoggedIn = (props) =>{

    
  

    return(
        <Fragment>
            <ul className="header">
                <li className="headerItem" >Inventory</li>
                <li className="headerItem" >Profile</li>
            </ul>

            <ul className='itemArea'>
                <ul className='itemSelector'>
                    <ul className='itemTab selectedItem'>All Inventory</ul>
                    <ul className='itemTab'>Search</ul>
                    <ul onClick={() =>{props.logOut(true)}} className='itemTab'>Logout</ul>
                </ul>

                <li className="item">
                    <img className='image' src={logo}/>
                    <div className='itemDes'>Hello</div>
                </li>

                <li className="item"><img className='image' src={logo}/></li>
                <li className="item"><img className='image' src={logo}/></li>
            </ul>
    
        </Fragment>
    );
}

export default LoggedIn;
